import{_ as s,c as n,o as a,a as e}from"./app.9a9f499d.js";const m=JSON.parse('{"title":"凹语言贡献者协议","description":"","frontmatter":{},"headers":[],"relativePath":"community/wca.md"}'),l={name:"community/wca.md"},p=e(`<h1 id="凹语言贡献者协议" tabindex="-1">凹语言贡献者协议 <a class="header-anchor" href="#凹语言贡献者协议" aria-hidden="true">#</a></h1><p><strong>凹语言贡献者协议：<a href="https://gitcode.com/wa-lang/wa/blob/master/wca/wca.md" target="_blank" rel="noreferrer">https://gitcode.com/wa-lang/wa/blob/master/wca/wca.md</a></strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki" style="background-color:#2e3440ff;"><code><span class="line"><span style="color:#d8dee9ff;">我，作为邮箱____________的实际所有人，经仔细阅读，自愿签署“凹语言贡献者协议”，协议全文如下：</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">---协议正文开始---</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">凹语言贡献者协议</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">乙方：武汉凹语言科技有限公司</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">本凹语言贡献者协议（后续简称“本协议”）适用于我在武汉凹语言科技有限公司（后续简称“乙方”）下属项目（后续简称“项目”）中所做的任何贡献，并约定了我针对这些贡献授予乙方的各项权利。本协议具有法律约束力。</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">1. 在本协议中，术语“贡献”是指任何源代码、目标代码、补丁、工具、样例、图形、规范、手册、文档，或我以本邮箱地址上传或提交给项目的任何其他材料。</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">2. 关于我提交的贡献在全球范围内的版权、版权申请或版权注册：</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 我特此将贡献的共同所有权转让给乙方；在该转让无效或无法执行的情况下，我特此授予乙方永久的、不可撤销的、非排他性的、全球范围的、免费的、免版税的、无限制的许可，以行使该版权下的所有权利，这其中包括：根据乙方的选择，通过多级别的授权将这些相同的权利许可给第三方的权利；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 我同意：我与乙方中的任何一方均可任意处置贡献，就如同双方均为该贡献的唯一所有者一样。并且，若任意一方基于该贡献制作或创作衍生作品，该衍生作品的制作人是其唯一所有者；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 我同意：我不会向乙方及乙方的被许可人或受让人主张任何精神权利，同时乙方及乙方的被许可人或受让人对我无需承担任何道义责任；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 我同意：乙方可以基于贡献注册版权并行使与之相关的所有权利；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 我同意：我与乙方中的任何一方使用或分发贡献时，均无义务征得对方同意，亦无义务向对方付费。</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">3. 对于贡献所涉的我拥有的任何专利，或我可以在不向任何第三方付款的情况下获得的许可，我特此授予乙方永久的、不可撤销的、非排他性的、全球范围的、免费的、免版税的下列许可：</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 将贡献全部、部分或包含在任意产品中制造、使用、出售、提供销售、进出口或以其他方式转让；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 根据乙方的选择，通过多级别的授权将这些相同的权利许可给第三方。  </span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">4. 除上述规定外，我保留贡献的所有权利。本协议生效时间为我向乙方提交贡献之时。</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">5. 我承诺、保证并同意：</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 我提交的每项贡献都是原创作品，我可合法的根据本协议将贡献所涉权利授予乙方；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 据我所知，每项贡献都不会侵犯任何第三方的版权、商标、专利或其他知识产权；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 每项贡献均符合中华人民共和国出口管制法律及其他适用的进出口法律；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 我在本协议中提供的邮箱信息真实有效；</span></span>
<span class="line"><span style="color:#d8dee9ff;">- 我通过本邮箱向乙方指定邮箱（wca@wa-lang.org）发送本协议电子档/扫描件/数字照片，既视同我签署本协议，且为我本人的真实意愿表达。</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">6. 我同意：在任何情况下，若发现会使上述陈述不准确的信息时应通知乙方相关情况。乙方有权公开披露我参与项目的情况，包括我已签署本协议的事实。</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">7. 本协议受中华人民共和国的相关法律管辖，他国法律规则均不适用。</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span>
<span class="line"><span style="color:#d8dee9ff;">---协议正文结束---</span></span>
<span class="line"><span style="color:#d8dee9ff;"></span></span></code></pre></div><p><strong>凹语言贡献者协议：<a href="https://gitcode.com/wa-lang/wa/blob/master/wca/wca.md" target="_blank" rel="noreferrer">https://gitcode.com/wa-lang/wa/blob/master/wca/wca.md</a></strong></p>`,4),o=[p];function c(d,t,f,r,i,y){return a(),n("div",null,o)}const g=s(l,[["render",c]]);export{m as __pageData,g as default};
